import { IParallax, Parallax, ParallaxLayer } from "@react-spring/parallax";
import iphone from '../Assets/IphoneHome.png';



export default function () {
    return (
        <div>
            <div className="w-1/2">
                <Parallax pages={2}>
                    <ParallaxLayer
                        offset={0.9999}
                        speed={3}
                        factor={1}
                        sticky={{ start: 1, end: 2 }}
                        style={{
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center',
                        }}
                    >
                        <div className="w-96 ">
                            <img src={iphone}></img>
                        </div>
                    </ParallaxLayer>
                </Parallax>
            </div>
        </div>
    )
}
